.fullGradientButtonWithArrow {
    cursor: pointer;
    position: relative;
    margin: 0;
    padding: 0;

    display: flex;
    flex: auto;
    justify-content: space-around;

    min-width: min-content;
    width: 100%;
    max-width: 320px;

    background: $PurpleGradient;

    border-radius: 22px;
    border: 0px solid opacify($Purple, 1);
    
    outline: none;
}

.fullGradientButtonWithArrow__arrow {
    position: absolute;
}

.fullGradientButtonWithArrow__arrow {
	cursor: pointer;
	display: block;

	margin: 0;
	padding: 0;

	position: absolute;
	right: 16px;
	top: 21px;

	width: 14px;
	height: 2px;

	background-color: #FFFFFF;
}

.fullGradientButtonWithArrow__arrow::before {
	content: '';

	position: absolute;
	top: -3px;
	right: -3px;

	margin: 0;
	padding: 0;

	width: 11px;
	height: 2px;

	background-color: #FFFFFF;

	transform: rotate(45deg);
	-webkit-transform: rotate(45deg);
}

.fullGradientButtonWithArrow__arrow::after {
	content: '';

	position: absolute;
	top: 3px;
	right: -3px;

	margin: 0;
	padding: 0;

	width: 11px;
	height: 2px;

	background-color: #FFFFFF;

	transform: rotate(-45deg);
	-webkit-transform: rotate(-45deg);
}

.fullGradientButtonWithArrow__textContain {
    margin: 14px 30px 15px 30px;
    padding: 0;

    max-width: 200px;

    white-space: nowrap;

    font-family: Montserrat;
	font-style: normal;
	text-align: center;
	font-size: 12px;
	line-height: 15px;
	font-weight: 700;
	text-transform: uppercase;
	color: #FFFFFF;
}


.fullGradientButtonWithArrow:focus {
    box-shadow: 0px 0px 0px 1px $FocusColor;
}

.fullGradientButtonWithArrow:hover {
    opacity: 0.9;
}

.fullGradientButtonWithArrow:active {
    opacity: 0.5;
}

.fullGradientButtonWithArrow > .fullGradientButtonWithArrow__buttonFix,
.fullGradientButtonWithArrow:active .fullGradientButtonWithArrow__buttonFix,
.fullGradientButtonWithArrow:focus .fullGradientButtonWithArrow__buttonFix {
    margin: 0;
	padding: 0;
	
    position:relative;
    top: 0;
    left: 0;
}

